import React from 'react';
import './MainPage.css'
import Post from "../Post/Post";
import uploadImage from '../../images/upload.png';

function Mainpage() {

    let data = [
        {
            id:'1234',
            userName:'asd',
            postImage:'https://hatrabbits.com/wp-content/uploads/2017/01/random.jpg',
            likes:'1234',
            commentList: [
                {
                    "userName": "ASDS",
                    "commentId":"1234",
                    "timeStamp":"123456",
                    "description":"Comment 1"
                },
                {
                    "userName": "ASDS",
                    "commentId":"1234",
                    "timeStamp":"123456",
                    "description":"Comment 1"
                },
                {
                    "userName": "ASDS",
                    "commentId":"1234",
                    "timeStamp":"123456",
                    "description":"Comment 1"
                }
            ]
        },
        {
            id:'1234',
            userName:'AAAA',
            postImage:'https://hatrabbits.com/wp-content/uploads/2017/01/random.jpg',
            likes:'1234',
            commentList: [
                {
                    "userName": "DDDD",
                    "commentId":"1234",
                    "timeStamp":"123456",
                    "description":"Comment 1"
                },
                {
                    "userName": "ASDS",
                    "commentId":"1234",
                    "timeStamp":"123456",
                    "description":"Comment 1"
                },
                {
                    "userName": "ASDS",
                    "commentId":"1234",
                    "timeStamp":"123456",
                    "description":"Comment 1"
                }
            ]
        }
    ]
  return (
    <div>
        <div style={{"textAlign":"center", "margin":"10px", width:"650px"}}>
            <div className="fileupload">
                <img src={uploadImage} className="mainpage_uploadicon" alt=""/>
                <input type="file"/>
            </div>
        </div>
        {
            data.map((item, index) => (
                <Post post={item} />
            ))
        }



    </div>
  );
};

export default Mainpage;
